package com.soecode.lyf.dto;public class ScheduleJobDto {    private int id;    private String groupId;    private String scheduleId;    private String cron;    private int status;    private String lastExecuteTime;    private String nextExecuteTime;    private long costMillSeconds;	public int getId() {		return id;	}	public void setId(int id) {		this.id = id;	}	public String getGroupId() {		return groupId;	}	public void setGroupId(String groupId) {		this.groupId = groupId;	}	public String getScheduleId() {		return scheduleId;	}	public void setScheduleId(String scheduleId) {		this.scheduleId = scheduleId;	}	public String getCron() {		return cron;	}	public void setCron(String cron) {		this.cron = cron;	}	public int getStatus() {		return status;	}	public void setStatus(int status) {		this.status = status;	}	public String getLastExecuteTime() {		return lastExecuteTime;	}	public void setLastExecuteTime(String lastExecuteTime) {		this.lastExecuteTime = lastExecuteTime;	}	public String getNextExecuteTime() {		return nextExecuteTime;	}	public void setNextExecuteTime(String nextExecuteTime) {		this.nextExecuteTime = nextExecuteTime;	}	public long getCostMillSeconds() {		return costMillSeconds;	}	public void setCostMillSeconds(long costMillSeconds) {		this.costMillSeconds = costMillSeconds;	}}